import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate, Link } from 'react-router-dom';
import LoginPage from './Component/LoginPage';
import AdminDashboard from './Component/AdminDashboard';
import OwnersList from './Component/BooksPage';
import OwnerDetails from './Component/OwnerDetails';
import RegisterationOwner from './Component/RegisterationOwner';

const MenuButton = ({ onClick, isMenuOpen }) => {
  return (
    <button
      onClick={onClick}
      style={{
        position: 'absolute',
        top: '20px',
        left: '20px',
        backgroundColor: '#333',
        color: '#fff',
        border: 'none',
        padding: '10px 15px',
        fontSize: '16px',
        cursor: 'pointer',
      }}
    >
      <i className={`fas fa-bars ${isMenuOpen ? 'fa-times' : ''}`}></i>
    </button>
  );
};

const NavigationMenu = ({ isMenuOpen, handleLogout }) => {
  return (
    <nav
      style={{
        position: 'absolute',
        top: '60px',
        left: '20px',
        backgroundColor: '#fff',
        boxShadow: '0 2px 5px rgba(0, 0, 0, 0.1)',
        padding: '10px 20px',
        zIndex: 1,
        display: isMenuOpen ? 'block' : 'none',
      }}
    >
      <Link to="/" style={{ display: 'block', color: '#333', textDecoration: 'none', padding: '10px 0' }}>
        Home
      </Link>
      <Link to="/login" style={{ display: 'block', color: '#333', textDecoration: 'none', padding: '10px 0' }}>
        Login
      </Link>
      <Link to="/admin-dashboard" style={{ display: 'block', color: '#333', textDecoration: 'none', padding: '10px 0' }}>
        Admin Dashboard
      </Link>
      <Link to="/owners-list" style={{ display: 'block', color: '#333', textDecoration: 'none', padding: '10px 0' }}>
        Owners List
      </Link>
      <Link to="/owner-details" style={{ display: 'block', color: '#333', textDecoration: 'none', padding: '10px 0' }}>
        Owner Details
      </Link>
      <button
        onClick={handleLogout}
        style={{
          display: 'block',
          color: '#333',
          textDecoration: 'none',
          padding: '10px 0',
          backgroundColor: 'transparent',
          border: 'none',
          cursor: 'pointer',
        }}
      >
        Logout
      </button>
    </nav>
  );
};

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [currentUser, setCurrentUser] = useState(null);
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  useEffect(() => {
    // Check if the user is already logged in
    const storedUser = localStorage.getItem('currentUser');
    if (storedUser) {
      setCurrentUser(JSON.parse(storedUser));
      setIsLoggedIn(true);
    }
  }, []);

  const handleLogin = (user) => {
    setCurrentUser(user);
    setIsLoggedIn(true);
    localStorage.setItem('currentUser', JSON.stringify(user));
  };

  const handleLogout = () => {
    setCurrentUser(null);
    setIsLoggedIn(false);
    localStorage.removeItem('currentUser');
    setIsMenuOpen(false);
  };

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <Router>
      <div className="App">
        <MenuButton onClick={toggleMenu} isMenuOpen={isMenuOpen} />
        <NavigationMenu isMenuOpen={isMenuOpen} handleLogout={handleLogout} />
        <Routes>
          <Route path="/" element={<Navigate to="/login" />} />
          <Route path="/login" element={<LoginPage handleLogin={handleLogin} />} />
          <Route path="/admin-dashboard" element={<AdminDashboard />} />
          <Route path="/owners-list" element={<OwnersList />} />
          <Route path="/owner-details" element={<OwnerDetails />} />
          <Route path="/Registeration-Owner" element={<RegisterationOwner />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
